#[test]
fn identity_recovery_request_for_concordium_ip() {
    let res = identity_recovery_request_json(
            IdentityRecoveryRequestParameters {
                ip_info: IdentityProviderInfo {
                    identity: 0,
                    description: Description {
                        name: "Concordium testnet IP".to_string(),
                        url: "".to_string(),
                        description: "Concordium testnet identity provider".to_string(),
                    },
                    verify_key_hex: "".to_string(),
                    cdi_verify_key_hex: "2e1cff3988174c379432c1fad7ccfc385c897c4477c06617262cec7193226eca".to_string(),
                },
                global_context: GlobalContext {
                    on_chain_commitment_key_hex: "b14cbfe44a02c6b1f78711176d5f437295367aa4f2a8c2551ee10d25a03adc69d61a332a058971919dad7312e1fc94c5a8d45e64b6f917c540eee16c970c3d4b7f3caf48a7746284878e2ace21c82ea44bf84609834625be1f309988ac523fac".to_string(),
                    bulletproof_generators_hex: "".to_string(),
                    genesis_string: "Concordium Testnet Version 5".to_string(),
                },
                timestamp: 1709028205,
                id_cred_sec_hex: "170cd1c77e6f422f6591dd216a4658617908469d22e0b11db185385dd0962114".to_string(),
            }
        ).unwrap();

    let res_decoded_deterministic_fields: IdentityRecoveryRequestResult =
        serde_json::from_str(&res).unwrap();

    assert_eq!(
            res_decoded_deterministic_fields,
            IdentityRecoveryRequestResult {
                value: Versioned {
                    version: 0,
                    value: IdentityRecoveryRequestResultValue {
                        id_cred_pub_hex: "85e314099841868c14af612bf5107b2d8c6aaef665befa3be5bb7bcae0e492a392f40822fcbc9874863cbd50b67c88da".to_string(),
                        // proof_hex: "ea73529fd306a0695b121029b22e547e5b3a4255c1d77a27e28298d017f928f555445819f602748ec99bff31a8fc20605a8a25d6d931693fa4228fb2e92ce30f".to_string(),
                        timestamp: 1709028205,
                    },
                },
            }
        );
}

